f crime victims to the families of fentanyl overdose victims and ensures investigations to determine criminal liability for these overdoses. \\n\\nAB1598 would remove testing equipment used for testing for fentanyl or is its analogs from laws prohibiting drug paraphernalia. - offering protection for drug checking.\\n\\nSB519 - Decriminalizes numerous psychedelics + paraphernalia and testing equipment.\\n\\nSB75 is about increasing the prison sentences for people who sell fentanyl by 3-25 years, supported by numerous law enforcement organizations.\\n\\nSB350 is about giving those convicted of certain drug crimes explicit information about the danger of fentanyl, with the intention that they can be convicted of a higher crime in the case of a death. \\n\\nFrom the bill analysis:\\n\\u201cBy requiring those who are successfully prosecuted for the felony manufacture or distribution of fentanyl to explicitly confronted in a court of law with the fact that fentanyl is dangerous to human life, prosecutors will stand in a better position to later prosecute such offenders for second degree murder, should they chose to continue to engage in such a dangerous and destructive endeavor.\\u201d\\n\\nAb77 is dead, but looks like it was basically licensing for substance use treatment centers.\\n\\nAB1351 is also dead, but would have increased penalties in cases in which fentanyl is involved.\",U,[0,80],[0,1061670069],[0,0],[383,671216766],[383,671216766],U,\"mid.$cAAAAACGy4FWFWUc8fl_KAH0Ii3HG\",\"6902329915912974790\",[0,1061670069],U,false,[0,0],[0,2],[0,2],false,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,U,false,U,false,U,U,U,[0,3],false,[0,0],[0,1],U,U,[0,0],U,U,U,U,U,U),_=>LS.sp(\"setMessageTextHasLinks\",[0,1061670069],\"mid.$cAAAAACGy4FWFWUc8fl_KAH0Ii3HG\",[383,671216766]),_=>LS.sp(\"setForwardScore\",[0,1061670069],\"mid.$cAAAAACGy4FWFWUc8fl_KAH0Ii3HG\",[383,671216766],U),_=>LS.sp(\"setMessageDisplayedContentTypes\",[0,1061670069],\"mid.$cAAAAACGy4FWFWUc8fl_KAH0Ii3HG\",[38
